function findCommonElements(arr1, arr2) {
  let commonElements = [];
  for (let i = 0; i < arr1.length; i++) {
    for (let j = 0; j < arr2.length; j++) {
      if (arr1[i] === arr2[j]) {
      commonElements.add(arr1[i]);     
      break;
      }
    }
  }
  return commonElements;
}

// Examples

array1 = [1, 2, 3, 4, 5];
array2 = [4, 5, 6, 7, 8];

console.println(findCommonElements(array1, array2));

